import axios from 'axios';

const ENV_SEQUENCE_ELEMENTS_URL = 'envsequenceelements';


class UsersService {

    getUsers() {
        return axios.get(ENV_SEQUENCE_ELEMENTS_URL);
    }
}

export default new UsersService();
